var indexOfEmailInFocus = 0;
var searchText = document.getElementsByClassName("searchText")[0];
class Email {
  receiverEmailId;
  senderEmailId;
  subject;
  senderName;
  content;
  index;
  type;
  isStarred;
  constructor(
    index,
    receiverEmailId,
    senderEmailId,
    subject,
    senderName,
    content,
    type,
    isStarred
  ) {
    this.index = index;
    this.content = content;
    this.receiverEmailId = receiverEmailId;
    this.senderEmailId = senderEmailId;
    this.subject = subject;
    this.senderName = senderName;
    this.type = type;
    this.isStarred = isStarred;
  }
  createABriefEmail() {
    let emailBriefDiv = document.createElement("div");
    emailBriefDiv.classList.add("emailBrief");
    emailBriefDiv.classList.add("email-" + this.index);
    if (this.index == 0) {
      emailBriefDiv.classList.add("activeEmail");
    }
    let checkbox = document.createElement("input");
    checkbox.setAttribute("type", "checkbox");
    checkbox.classList.add("emailCheckbox");
    emailBriefDiv.appendChild(checkbox);
    let emailBriefContentDiv = document.createElement("div");
    emailBriefContentDiv.classList.add("emailBriefContent");
    let senderNameParagraph = document.createElement("p");
    senderNameParagraph.classList.add("recipient_name");
    senderNameParagraph.textContent = this.senderName;
    emailBriefContentDiv.appendChild(senderNameParagraph);
    let emailSubjectParagraph = document.createElement("p");
    emailSubjectParagraph.classList.add("email-subject");
    emailSubjectParagraph.textContent = this.subject;
    emailBriefContentDiv.appendChild(emailSubjectParagraph);
    let emailContentParagraph = document.createElement("p");
    emailContentParagraph.classList.add("email-content");
    emailContentParagraph.textContent =
      "This is a test content. Will change in future.";
    emailBriefContentDiv.appendChild(emailContentParagraph);
    emailBriefDiv.appendChild(emailBriefContentDiv);
    emailBriefDiv.addEventListener("click", function (e) {
      var index = -1;
      var classes = emailBriefDiv.classList;
      for (var i = 0; i < classes.length; i++) {
        if (classes[i].includes("-")) {
          index = parseInt(classes[i].split("-")[1]);
        }
      };
      if (index != -1) {
        if (
          document
            .getElementsByClassName("email-" + indexOfEmailInFocus)[0]
            .classList.contains("activeEmail")
        ) {
          document
            .getElementsByClassName("email-" + indexOfEmailInFocus)[0]
            .classList.remove("activeEmail");
        }
        emailBriefDiv.classList.add("activeEmail");
        indexOfEmailInFocus = index;
        showNewContent(index);
      }
    });
    return emailBriefDiv;
  }
}
function setOrUnsetAllCheckBoxes(value)
{
  var checkboxToCheckAll = document.getElementsByClassName("checkboxToCheckAll")[0];
  
  if(checkboxToCheckAll.checked)
  {
    var checkboxes = document.getElementsByClassName("emailCheckbox");
    for(var i = 0;i<checkboxes.length;i++) {
      checkboxes[i].checked = true;
    }
  }
  else {
    var checkboxes = document.getElementsByClassName("emailCheckbox");
    for(var i = 0;i<checkboxes.length;i++) {
      checkboxes[i].checked = false;
    }
  }
}

