function changeResultBasedOnSearchText(e) {
    var child = emailsInBriefDiv.firstElementChild;
    while (child) {
      emailsInBriefDiv.removeChild(child);
      child = emailsInBriefDiv.firstElementChild;
    }
    for (var i = 0; i < emails.length; i++) {
        console.log(emails[i].subject, e, emails[i].subject.includes(e)); 
      if (emails[i].subject.includes(e) || emails[i].senderName.includes(e)) {
        emailsInBriefDiv.appendChild(emails[i].createABriefEmail());
      }
    } 
}
